    [],nt"num_tags": 6,nt"name": "2010-update-to-crested-wheatgrass-control-and-monitoring-benton-lake-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "Crested wheatgrass (CWG) was planted on
    Benton Lake NWR at least 30 years ago, presumably to stabilize the soil where it
    had been disturbed in the process of building refuge roads, and possibly burying
    utility lines. Areas of the Refuge dominated by CWG have low plant diversity and
    are unfavorable to breeding grassland birds. A pilot program to control CWG began
    in 2008 and this report provides an update of the program as of 2010. Materials,
    control methods, results, and discussion are provided for both established stands
    and pioneer stands.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
